            <p>Stunting Checker adalah sebuah aplikasi yang dirancang untuk membantu orang tua dan petugas kesehatan dalam memantau dan mencegah stunting pada anak-anak. Aplikasi ini menawarkan berbagai fitur, termasuk grafik pertumbuhan, tips nutrisi, dan panduan perkembangan anak.</p>
